import React from 'react';
import { navData } from '../../Data/NavigationData.tsx';
import Image from '../../images/logo.png';
import {
  NavWrapper,
  Wrapper,
  Logo,
  LogoImage,
  LogoLink,
  MenuBars,
  NavMenu,
  NavMenuLinks,
  Button,
} from './NavBarStyles';
import { ConnectWallet } from "../../components/ConnectWallet"

const NavbarMain = ({ page }) => {
  return (
    <NavWrapper>
      <Wrapper>
        <Logo>
          <LogoImage src={Image} alt='Logo Image' />
          <LogoLink to='/'>DAHLIA</LogoLink>
        </Logo>
        <MenuBars />
        <NavMenu>
          {navData.map((item, index) => {
            return (
              <NavMenuLinks
                to={item.link}
                key={index}
                className={page === item.title ? 'active' : null}
              >
                {item.title}
              </NavMenuLinks>
            );
          })}
        </NavMenu>
        <ConnectWallet />
      </Wrapper>
    </NavWrapper>
  );
};

export default NavbarMain;
